import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
// import App from './App';
import $ from 'jquery';
import InputCpu from './components/InputCpu';
import InputMotherboard from './components/InputMotherboard';
import InputGPU from './components/InputGPU';


$('#ambilCPU').on('click', function (event) {
  ReactDOM.render(
    <React.StrictMode>
      <div className='container'>
        <InputCpu />
      </div>
    </React.StrictMode>,
    document.getElementById('root')
  );
});

$('#ambilMotherboard').on('click', function (event) {
  ReactDOM.render(
    <React.StrictMode>
      <div className='container'>
        <InputMotherboard />
      </div>
    </React.StrictMode>,
    document.getElementById('root')
  );
});

$('#ambilVGA').on('click', function (event) {
  ReactDOM.render(
    <React.StrictMode>
      <div className='container'>
        <InputGPU />
      </div>
    </React.StrictMode>,
    document.getElementById('root')
  );
});

$('#ambilSSD').on('click', function (event) {
  ReactDOM.render(
    <React.StrictMode>
      <div className='container'>
        <inputStorage />
      </div>
    </React.StrictMode>,
    document.getElementById('root')
  );
});

$('#ambilFan').on('click', function (event) {
  ReactDOM.render(
    <React.StrictMode>
      <div className='container'>
        <inputFan />
      </div>
    </React.StrictMode>,
    document.getElementById('root')
  );
});

$('#ambilCase').on('click', function (event) {
  ReactDOM.render(
    <React.StrictMode>
      <div className='container'>
        <inputCasing />
      </div>
    </React.StrictMode>,
    document.getElementById('root')
  );
});
